import React from "react";

import './Home.css'
import ProductList from "./protectedComponents/ProductList";
const Home = ({ name }) => {

    if (name !== "bhavik") {
        throw new Error("something went wrong!!")
    }

    return (
        <div className="maindiv">
            <header className="header">
                <div className="icon">
                <i className="fa-solid fa-cart-shopping"></i>
                </div>
                <div className="para">
                    <p>Product List :</p>

                </div>
                <div className="productlist">
                        <ProductList/>
                    </div>

            </header>

        </div>
    )
}
export default Home
